// BluebookDetails.jsx

import React, { useState, useEffect } from 'react';
import { getSingleBluebookApi } from '../../apis/Api';
import { useParams } from 'react-router-dom';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './BluebookDetails.css';

const BluebookDetails = () => {
    const { bluebookId } = useParams();
    const [bluebook, setBluebook] = useState(null);
    const [loading, setLoading] = useState(true);
  
    useEffect(() => {
      fetchBluebook();
    }, []);
  
    const fetchBluebook = async () => { 
      try {
        const response = await getSingleBluebookApi(bluebookId);
        setBluebook(response.data.bluebook);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching bluebook:', error);
        toast.error('Error fetching bluebook');
      }
    };
  
    if (loading) {
      return <p>Loading...</p>;
    }
  
    if (!bluebook) {
      return <p>No bluebook found.</p>;
    }
  
    return (
      <div className="bluebook-details-container">
        <h2 className="bluebook-details-title">Bluebook Details</h2>
        <div className="bluebook-details-form">
          <div className="column">
            <div className="form-group">
              <label htmlFor="bluebookName">Owner Name:</label>
              <input type="text" id="bluebookName" value={bluebook.bluebookName} disabled />
            </div>
            <div className="form-group">
              <label htmlFor="registrationAuthority">Registration Authority:</label>
              <input type="text" id="registrationAuthority" value={bluebook.registrationAuthority} disabled />
            </div>
            <div className="form-group">
              <label htmlFor="vehicleClass">Vehicle Class (CC):</label>
              <input type="text" id="vehicleClass" value={bluebook.vehicleClass} disabled />
            </div>
            <div className="form-group">
              <label htmlFor="fuelType">Fuel Type:</label>
              <input type="text" id="fuelType" value={bluebook.fuelType} disabled />
            </div>
          </div>
          <div className="column">
            <div className="form-group">
              <label htmlFor="vehicleManufactured">Vehicle Manufactured Year:</label>
              <input type="number" id="vehicleManufactured" value={bluebook.vehicleManufactured} disabled />
            </div>
            <div className="form-group">
              <label htmlFor="taxPaid">Tax Paid:</label>
              <input type="date" id="taxPaid" value={bluebook.taxPaid} disabled />
            </div>
            <div className="form-group">
              <label htmlFor="validUpTo">Valid Up To:</label>
              <input type="date" id="validUpTo" value={bluebook.validUpTo} disabled />
            </div>
            <div className="form-group">
              <label htmlFor="bluebookStatus">Status:</label>
              <input type="text" id="bluebookStatus" value={bluebook.bluebookStatus} disabled />
            </div>
          </div>
        </div>
      </div>
    );
};

export default BluebookDetails;
